// Mobile screens
#home {
  position: relative;
  background: linear-gradient(to right, $secondary, $primary);
  color: white;
  display: flex;
  align-items: center;
  justify-content: flex-start;

  #bg-vector {
    &-circle {
      position: absolute;
      top: -10%;
      right: -20%;
      // animation: grow_circle 1s ease-in forwards;
      width: 70%;
      height: auto;
    }

    &-waves {
      position: absolute;
      bottom: 0;
      right: 0;

      &__1,
      &__2 {
        position: absolute;
        bottom: 0;
        right: 0;
        transform-origin: right bottom;
      }

      &__1 {
        animation: move_wave_1 10s ease-in-out infinite;
      }

      &__2 {
        animation: move_wave_1 10s 2s ease-in-out infinite alternate;
        opacity: 0;
      }
    }
  }

  h1 {
    font-size: 2.2rem;
    margin: 1.5 * $units 0 2.5 * $units 0;
    width: 100%;
    line-height: 1.4;
  }

  p.body-text {
    color: rgba($color: white, $alpha: 0.9);
    margin: 0 * $units 0;
    width: 100%;
  }

  .cta {
    margin-top: 5.5 * $units;
    display: inline-flex;
    flex-direction: column;
    justify-content: center;
    align-items: flex-start;

    .social-handles {
      display: inline-flex;
      justify-content: space-between;
      align-items: center;
      margin-top: 4 * $units;

      a {
        margin: 0 1.7 * $units;
        height: 0.9rem;

        &:first-child {
          margin-left: $units;
        }

        img {
          height: 100%;
        }
      }
    }
  }
}

@keyframes move_wave_1 {
  0% {
    transform: translateZ(0) scaleY(1) scaleX(1);
    opacity: 0;
  }

  25% {
    opacity: 1;
  }

  50% {
    transform: translateZ(0) scaleY(0.7) scaleX(1.5);
    opacity: 0;
  }

  75% {
    opacity: 1;
  }

  100% {
    transform: translateZ(0) scaleY(1) scaleX(1);
    opacity: 0;
  }
}

@keyframes grow_circle {
  0% {
    opacity: 0;
    transform: scale(0) translateY(-100%) rotate(45deg);
  }

  80% {
    opacity: 0.6;
    transform: scale(1.2) translateY(0) rotate(0);
  }

  100% {
    opacity: 1;
    transform: scale(1);
  }
}

